import React from "react";
import "./OnBording1.css";
import img from "./../Assets/OnBording1.png";

function OnBording1() {
  return (
    <div className="OnBording1">
      <img
        src={img}
        style={{ width: "100vw", height: "100vh" }}
        alt="Background Img"
      />
    </div>
  );
}

export default OnBording1;
